<script src="https://cdnjs.cloudflare.com/ajax/libs/d3-legend/2.25.6/d3-legend.min.js"></script>
<script>

let width = 1000, height = 1000;

let svg = d3.select("svg")
    .attr("viewBox", "0 0 " + width + " " + height)

// Colorscale
var colorScale = d3.scaleOrdinal()
  .domain([0, 70000])
  .range(d3.schemeBlues[8]);

var ordinalScale = d3.scaleOrdinal()
  .domain([0, 10000, 20000, 30000, 40000, 50000, 60000, 70000])
  .range(d3.schemeBlues[8]);

// Legend
var legend = d3
  .legendColor()
  .scale(ordinalScale)
  .shapeWidth(80)
  .orient("horizontal")
  .cells(1)
  .title("Population Count");

// Load external data
Promise.all([d3.json("https://chi-loong.github.io/CSC3007/assignments/sgmap.json"), d3.csv("https://chi-loong.github.io/CSC3007/assignments/population2021.csv")]).then(data => {

    console.log(data[0].features);
    console.log(data[1]);

    // Map and projection
    var projection = d3.geoMercator()
        .center([103.851959, 1.290270])
        .fitExtent([[20, 20], [980, 580]], data[0]);

    let geopath = d3.geoPath().projection(projection);

    svg.append("g")
        .attr("id", "districts")
        .selectAll("path")
        .data(data[0].features)
        .enter()
        .append("path")
        .attr("d", geopath)
        .attr("fill", d=>
        colorScale(d.properties.Name)
        )

    svg.append("g").attr("transform", "translate(20,600)").call(legend);
})

</script>
